import React, { useState } from 'react';

const Form = () => {
    const [name,setname]=useState("");
    const [namesend,setnamesend]=useState("");
    const [name2,setname2]=useState("");
    const [namesend2,setnamesend2]=useState("");
    const get=(e)=>{
        setname(e.target.value);
    }
    const get2=(e)=>{
        setname2(e.target.value);
    }
    const submit=(e)=>{
       e.preventDefault();
       setnamesend(name);
       setnamesend2(name2);
    }
  return(
   <>
   <input type="text" value={name} onChange={get}  placeholder="enter your name"/>
   <br />
   <input type="text"  value={name2} onChange={get2} placeholder='enter your father name'/>
   <br />
   <button onClick={submit}>send</button>
   <br />
   <h1>form data is </h1>
   </>
  );
};

export default Form;
